import React from 'react';
import './Navbar.css';  

const Navbar = () => {
  return (
    <nav className="navbar">
      <h2>Finance Portal</h2>
      <div className="search-container">
        <input
          type="text"
          placeholder="Search..."
          className="search-bar"
        />
      </div>
    </nav>
  );
}

export default Navbar;
